import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <Link to="/">Каталог</Link>
      <Link to="/blog">Блог</Link>
      <Link to="/contacts">Контакты</Link>
      <Link to="/account">Личный кабинет</Link>
    </nav>
  );
}

export default Navbar;
